import Image from "./Image.js";
import React from 'react';
import {Helmet} from 'react-helmet';

export default function App() {
  let christmas_pepe=
  {
    name: 'Christmas Pepe',
    url: 'https://i.imgur.com/c76UqNN.gif',
    width: 400,
    height: 400,
    top: '50%',
    left: '50%',
    // transform: 'translate(-50%, -50%)'
  };
  let merry_christmas=
  {
    name: 'Merry Christmas',
    url: 'https://external-content.duckduckgo.com/iu/?u=https%3A%2F%2Fwww.madeiraislandnews.com%2Fwp-content%2Fuploads%2F2016%2F12%2Fmerry-christmas-clip-art-images1-klein-school-0cTsDF-clipart.png&f=1&nofb=1',
    width: 800,
    height: 250,
    top: '15%',
    left: '50%',
    // transform: 'translate(-25%, 50%)'

  }

  return (
    <div>
     <Helmet><style>{'body { background-color: lightblue; }'}</style></Helmet>
     <ul style={{
       color: 'black'
     }}>
       <h1>Merry Christmas!</h1>
      </ul>
      <Image icon={christmas_pepe} />
      <Image icon={merry_christmas} />
    </div>
  );
}
